import React,{Component} from 'react';
import { Grid, Cell } from 'react-mdl';
import Resume from '../Resume.pdf';

export default class LandingPage extends Component{
    render(){
        return(
            <div className="landing-page" id="landing" style={{width:'100%',margin:'auto'}}>
                <Grid className="landing-page">
                    <Cell col={12}>INTRODUCTION</Cell>
                    <p className="resume-text"><a href={Resume} style={{width:'100%',margin:'auto'}} target="blank">VIEW RESUME</a></p>
                </Grid>
            </div> 
        )
    }
}
